            new ConcurrentDictionary<string, TicketingAttachmentResultValue>(_knownValues);

        private TicketingAttachmentResultValue(string value)
        {
            if (value == null) throw new ArgumentNullException(nameof(value));
            Value = value;
        }

        public string Value { get; }

        public static TicketingAttachmentResultValue Of(string value)
        {
            return _values.GetOrAdd(value, _ => new TicketingAttachmentResultValue(value));
        }

        public static implicit operator TicketingAttachmentResultValue(string value) => Of(value);
        public static implicit operator string(TicketingAttachmentResultValue ticketingattachmentresultvalue) => ticketingattachmentresultvalue.Value;

        public static TicketingAttachmentResultValue[] Values()
        {
            return _values.Values.ToArray();
        }

        public override string ToString() => Value.ToString();

        public bool IsKnown()
        {
            return _knownValues.ContainsKey(Value);
        }

        public override bool Equals(object? obj) => Equals(obj as TicketingAttachmentResultValue);

        public bool Equals(TicketingAttachmentResultValue? other)
        {
            if (ReferenceEquals(this, other)) return true;
            if (other is null) return false;
            return string.Equals(Value, other.Value);
